Julia Ann, Celeste Star, Dana Vespoli, Karlie Montana


Catch a ride with these lesbian hitchhikers!
Celeste and Karlie are two young girls with nothing but open road ahead of them as they hit the promised land: California. Julia and Dana are a professional lesbian couple whose work problems have been hampering their sex life. When a random busted engine brings these two pairs together, fates come to crossroads and new directions are discovered. Authentic lesbian passion and orgasms comes naturally out of real drama in this Dana Vespoli movie.
